import React from "react";
import Dog from "react-svg-loader!../../public/dog2.svg";

const Header = () => {
  return (
    <div className="header">
      <div className="container">
        <div class="visual">
          <div className="svg-wrapper">
            <Dog className="svg" />
          </div>
        </div>
        <div className="content">
          <h1>
            adoptuj<span>zwierzaka</span>.pl
          </h1>
        </div>
      </div>

      <style jsx>
        {`
          .header {
            height: 100vh;
            background: rgb(170, 209, 93);
            background: linear-gradient(
              74deg,
              rgba(170, 209, 93, 1) 0%,
              rgba(109, 190, 69, 1) 81%,
              rgba(7, 153, 72, 1) 100%
            );
          }

          .content {
            background: white;
          }

          h1 {
            font-size: 40px;
          }

          h1 span {
            color: var(--main-color);
            display: block;
          }

          .svg-wrapper {
            width: 100%;
          }
        `}
      </style>
    </div>
  );
};

export default Header;
